    false,nt"url": null,nt"notes": "The West Coast Observing System (WCOS)
    project provides access to temperature and currents data collected at four of the
    five National Marine Sanctuary sites, including Olympic Coast, Gulf of the Farallones,
    Monterey Bay, and Channel Islands. A semi-automated end-to-end data management system
    transports and transforms the data from source to archive, making the data acessible
    for discovery, access and analysis from multiple Internet points of entry.nnThe
    stations (and their code names) are San Miguel North (BAY), Santa Rosa North (BEA),
    Cuyler Harbor (CUY), Pelican/Prisoners Area (PEL), San Miguel South (SMS), Santa
    Rosa South (SRS), Valley Anch (VAL).",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
